import React from "react";
import style from "./Navbar.module.css";
import NavbarCartButton from "./NavbarCartButton";

const Navbar = () => {
  return (
    <header className={style.header}>
      <h1>Mangan Resto</h1>
      <NavbarCartButton name="Cart" />
    </header>
  );
};

export default Navbar;
